import React from 'react';
import { useNavigate } from 'react-router-dom';
import Rankings from './home/Rankings';
import News from './home/News.js';
import FeaturedMatches from './home/FeaturedMatches.js';
import TeamFixtures from './home/TeamFixtures.js';
import TopPlayers from './home/TopPlayers';
import TopSeries from './home/TopSeries';
import './css/Home.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <div className="home-section">
        <FeaturedMatches navigate={navigate} />
        <Rankings />
        <TeamFixtures />
        <TopPlayers />
      </div>

      <div className="side-widgets">
        <News />
        <TopSeries />
      </div>
    </div>
  );
};

export default Home;
